import React from "react";
import '../css/chartbox.css';
import {Bar} from 'react-chartjs-2';

function ChartBox(){
    return(
        <>
           <div className="chart-card">
               <Bar 
                data={{
                    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange']
                }}
                height={400}
                width={600}
               />
           </div>
        </>
    );
}

export default ChartBox;
